  formatTimeParams(v) {
    return v ? parseInt(new Date(v).getTime() / 1000) : undefined;
  }

  formateTransactionsCount(text, item, index) {
    const percent =
      parseFloat(
        item.data?.angleField / this.state.overview?.transactionsCountTotal
      )?.toFixed(2) * 100;
    return (
      <span>
        <span
          style={{
            display: 'inline-block',
            width: '100px',
          }}
        >
          {text}
        </span>
        <span
          style={{
            float: 'right',
          }}
        >
          {percent} %
        </span>
      </span>
    );
  }

  getAllQueryBySeg() {
    this.getQueryBySeg({
      type: 'blockH',
      query: {
        from: parseInt(new Date().getTime() / 1000 - 3600 * 24),
        interval: 3600,
        number: 24,
        type: 'blocks',
      },
    });
    this.getQueryBySeg({
      type: 'transactionH',
      query: {
        from: parseInt(new Date().getTime() / 1000 - 3600 * 24),
        interval: 3600,
        number: 24,
        type: 'transactions',
      },
    });
    this.getQueryBySeg({
      type: 'blockM',
      query: {
        from: parseInt(new Date().getTime() / 1000 - 60 * 60),
        interval: 60,
        number: 60,
        type: 'blocks',
      },
    });
    this.getQueryBySeg({
      type: 'transactionM',
      query: {
        from: parseInt(new Date().getTime() / 1000 - 60 * 60),
        interval: 60,
        number: 60,
        type: 'transactions',
      },
    });
  }

  getBrowserBlocks() {
    this.setState({
      block: {
        ...this.state.block,
        loading: true,
      },
    });
    this.dataSourceMap.getBrowserBlocks
      .load({})
      .then((res) => {
        this.setState({
          block: {
            ...this.state.block,
            total: res?.count,
            list: res?.data,
            loading: false,
          },
        });
      })
      .catch((error) => {
        this.setState({
          block: {
            ...this.state.block,
            total: 0,
            list: [],
            loading: false,
          },
        });
      });
  }

  getBrowserTransactions() {
    this.setState({
      transaction: {
        ...this.state.transaction,
        loading: true,
      },
    });
    this.dataSourceMap.getBrowserTransactions
      .load({})
      .then((res) => {
        this.setState({
          transaction: {
            ...this.state.transaction,
            total: res?.count,
            list: res?.data,
            loading: false,
          },
        });
      })
      .catch((error) => {
        this.setState({
          transaction: {
            ...this.state.transaction,
            total: 0,
            list: [],
            loading: false,
          },
        });
      });
  }

  async getMyChannels() {
    try {
      const res = await this.props.appHelper.utils.bff.getMyChannels();
      const myChannels =
        []?.concat(res?.channels)?.map((item) => ({
          ...item,
          value: `${item.network}_${item.name}`,
          label: `${item.network}_${item.displayName}`,
        })) || [];
      this.setState(
        {
          myChannels,
          network: myChannels?.[0]?.value,
        },
        () => {
          this.loadData();
        }
      );
    } catch (error) {}
  }

  getOverview() {
    this.setState({
      overview: {
        ...this.state.overview,
        loading: true,
      },
    });
    this.dataSourceMap.getOverviewSummary
      .load({})
      .then((res) => {
        this.setState({
          overview: {
            ...this.state.overview,
            data: res || {},
            loading: false,
          },
        });
      })
      .catch((error) => {
        this.setState({
          overview: {
            ...this.state.overview,
            data: {},
            loading: false,
          },
        });
      });
  }

  getQueryBySeg({ type, query }) {
    this.setState({
      overview: {
        ...this.state.overview,
        loading: true,
      },
    });
    this.dataSourceMap.getQueryBySeg
      .load(query)
      .then((res) => {
        this.setState({
          overview: {
            ...this.state.overview,
            [type]: res?.map((item) => ({
              seriesField: this.i18n('i18n-1pf627eu'),
              xField: item.end * 1000,
              yField: item.count,
            })),
            loading: false,
          },
        });
      })
      .catch((error) => {
        this.setState({
          overview: {
            ...this.state.overview,
            [type]: [],
            loading: false,
          },
        });
      });
  }

  getTransactionsCount() {
    this.setState({
      overview: {
        ...this.state.overview,
        loading: true,
      },
    });
    this.dataSourceMap.getTransactionsCount
      .load({})
      .then((res) => {
        console.log(res?.data);
        this.setState({
          overview: {
            ...this.state.overview,
            transactionsCount:
              res?.data?.map((item) => ({
                angleField: item.count || 0,
                seriesField: item.creator || '-',
              })) || [],
            transactionsCountTotal: res?.data?.reduce(
              (prev, cur, index, arr) => {
                return prev + cur?.count;
              },
              0
            ),
            loading: false,
          },
        });
      })
      .catch((error) => {
        this.setState({
          overview: {
            ...this.state.overview,
            transactionsCount: [],
            loading: false,
          },
        });
      });
  }

